import{_ as e,c as t,o as c,a}from"./app.c0b292da.js";const u=JSON.parse('{"title":"\u5E26\u8D27","description":"","frontmatter":{},"headers":[{"level":2,"title":"\u653F\u5E9C\u516C\u544A\u8FC7\u5EA6\u5F3A\u8C03\u7A33\u7684\u540E\u679C","slug":"\u653F\u5E9C\u516C\u544A\u8FC7\u5EA6\u5F3A\u8C03\u7A33\u7684\u540E\u679C","link":"#\u653F\u5E9C\u516C\u544A\u8FC7\u5EA6\u5F3A\u8C03\u7A33\u7684\u540E\u679C","children":[]}],"relativePath":"3/commerce.md"}'),o={name:"3/commerce.md"},p=a('<h1 id="\u5E26\u8D27" tabindex="-1">\u5E26\u8D27 <a class="header-anchor" href="#\u5E26\u8D27" aria-hidden="true">#</a></h1><h2 id="\u653F\u5E9C\u516C\u544A\u8FC7\u5EA6\u5F3A\u8C03\u7A33\u7684\u540E\u679C" tabindex="-1">\u653F\u5E9C\u516C\u544A\u8FC7\u5EA6\u5F3A\u8C03\u7A33\u7684\u540E\u679C <a class="header-anchor" href="#\u653F\u5E9C\u516C\u544A\u8FC7\u5EA6\u5F3A\u8C03\u7A33\u7684\u540E\u679C" aria-hidden="true">#</a></h2><div class="info custom-block"><p class="custom-block-title">\u4F5C\u8005\u4FE1\u606F</p><ul><li>ID\uFF1A \u84DD\u8272\u9690\u58EB</li><li>\u5E73\u53F0\uFF1AQQ</li><li>\u8054\u7CFB\u65B9\u5F0F\uFF1A7722704</li></ul></div><p>\u5728\u67D0\u4E00\u671F\u7761\u524D\u6D88\u606F\u89E3\u8BFB\u4E86\u4ECA\u5E74\u7684\u653F\u5E9C\u516C\u544A\uFF0C\u91CC\u9762\u7684\u7A33\u5B57\u6BD4\u4EE5\u5F80\u8981\u591A\u5F88\u591A\uFF0C\u6240\u4EE5\u9A6C\u7763\u5DE5\u9884\u8BA1\u4ECA\u5E74\u4E0D\u4F1A\u6536\u623F\u4EA7\u7A0E\u4E86\uFF0C\u53EF\u662F\u5C31\u4E0A\u534A\u5E74\u53D1\u751F\u7684\u4E8B\u60C5\u800C\u8A00\uFF0C\u8FD9\u53EF\u80FD\u5C31\u662F\u8FC7\u5EA6\u5F3A\u8C03\u7A33\u7684\u540E\u679C\u3002</p><p>1\uFF1A\u623F\u5730\u4EA7\u66B4\u96F7\uFF0C\u4E70\u623F\u8005\u65AD\u4F9B\u4E8B\u4EF6\u5927\u5E45\u5EA6\u66B4\u6DA8\u3002</p><p>\u623F\u4EA7\u5546\uFF1A\u653F\u5E9C\u4ECA\u5E74\u4E0D\u662F\u4FDD\u7A33\u4E48\uFF0C\u90A3\u597D\uFF0C\u4ECA\u5E74\u66B4\u96F7\u7684\u8BDD\u653F\u5E9C\u80AF\u5B9A\u80FD\u6258\u5E95\u9632\u6B62\u6CE1\u6CAB\u6DA8\u7834\u3002\u5982\u679C\u78B0\u5230\u6FC0\u8FDB\u53D1\u5C55\u7684\u5E74\u4EE3\u53EF\u80FD\u5C31\u56E0\u4E3A\u5FD9\u4E8E\u6295\u8D44\u800C\u4E0D\u4F1A\u7BA1\u66B4\u96F7\u4E8B\u4EF6\u3002</p><p>2\uFF1A\u6751\u9547\u94F6\u884C\u66B4\u96F7\u540C\u7406\uFF0C\u540C\u65F6\u9020\u6210\u5176\u4ED6\u7701\u5E02\u6751\u9547\u94F6\u884C\u6324\u5151\u4E8B\u4EF6\u53D1\u751F\u3002</p><p>\u4EE5\u524D\u603B\u6709\u4EBA\u56B7\u56B7\u7740\u653F\u5E9C\u4E0D\u8BE5\u5784\u65AD\u94F6\u884C\uFF0C\u5E94\u8BE5\u653E\u5F00\u7BA1\u63A7\uFF0C\u73B0\u5728\u6751\u9547\u94F6\u884C\u8FD8\u53EA\u662F\u90E8\u5206\u653E\u5F00\uFF0C\u5C31\u66B4\u96F7\u5BFC\u81F4\u8BB8\u591A\u50A8\u6237\u5FC3\u8840\u767D\u8D39\u3002\u6700\u8FD1\u56FD\u6709\u94F6\u884C\u5B58\u6B3E\u6BD4\u4F8B\u98D9\u5347\uFF0C\u662F\u56E0\u4E3A\u6295\u8D44\u65E0\u671B\u52A0\u4E0A\u5BF9\u4E2D\u5C0F\u94F6\u884C\u7684\u4E0D\u4FE1\u4EFB\u9020\u6210\uFF0C\u5F80\u5E74\u5E74\u4E2D\u5404\u5927\u884C\u4E3A\u4E86\u5B8C\u6210\u4E1A\u7EE9\u6307\u6807\uFF0C\u4F1A\u53D1\u5E03\u63FD\u50A8\u4EFB\u52A1\uFF0C\u6BD4\u59827\u5929\u9AD8\u606F\u7B49\u7B49\uFF0C\u4ECA\u5E74\u5374\u662F\u6BEB\u65E0\u97F3\u8BAF\u3002\u53CD\u800C\u8D37\u6B3E\u4EFB\u52A1\u56F0\u96BE\u91CD\u91CD\uFF0C\u4E0D\u65AD\u4E0B\u8C03\u5229\u7387\uFF08\u623F\u8D37\uFF0C\u6D88\u8D39\u8D37\uFF0C\u4E2A\u4EBA\u8D37\u90FD\u662F\u5386\u53F2\u540C\u671F\u6700\u4F4E\u6C34\u5E73\uFF09\u4E5F\u5F88\u96BE\u5B8C\u6210</p><p>3\uFF1A\u6F02\u4EAE\u56FD\u7814\u7A76\u4E2D\u56FD\u653F\u7B56\u7684\u4EBA\u5458\u4E5F\u53D1\u73B0\u4ECA\u5E74\u4F1A\u8FC7\u5EA6\u6C42\u7A33\uFF0C\u56E0\u6B64\u4F17\u8BAE\u9662\u8BAE\u957F\u7A9C\u8BBF\u53F0\u6E7E\u7701\uFF0C\u5927\u9646\u8FD9\u8FB9\u4E5F\u4E0D\u4F1A\u771F\u7684\u8DDF\u6F02\u4EAE\u56FD\u6495\u7834\u8138\u76AE\uFF0C\u54EA\u6015\u62A5\u9053\u6B64\u4E8B\u7684\u8BB0\u8005\u53EB\u201C\u5434\u6850\u201D\uFF0C\u4E5F\u4E0D\u4F1A\u771F\u7684\u6253\u8FC7\u53BB\uFF0C\u519B\u4E8B\u6F14\u4E60\u4E5F\u53EA\u662F\u80FD\u505A\u5230\u7684\u6781\u81F4\u4E86\u3002</p><p>\u987A\u4FBF\u5E2E\u81EA\u5DF1\u7684\u5BB6\u4E61\u5E26\u8D27\uFF0C\u5927\u591A\u6570\u6C34\u679C\u90FD\u662F\u79CB\u5929\u6210\u719F\uFF0C\u800C\u6211\u4EEC\u8FD9\u91CC\u6709\u4E00\u79CD\u590F\u5929\u6210\u719F\u7684\u6C34\u679C\uFF0C\u90A3\u5C31\u662F\u3010\u767E\u91CC\u6D32\u7802\u68A8\u3011</p><p>\u6E56\u5317\u7701\u679D\u6C5F\u5E02\u767E\u91CC\u6D32\u9547\u7279\u4EA7\uFF0C\u767E\u91CC\u6D32\u7802\u68A8\uFF0C\u6E56\u5317\u7701\u679D\u6C5F\u5E02\u767E\u91CC\u6D32\u9547\u7279\u4EA7\uFF0C\u4E2D\u56FD\u56FD\u5BB6\u5730\u7406\u6807\u5FD7\u4EA7\u54C1\u3002</p><p>\u767E\u91CC\u6D32\u7802\u68A8\u542B\u6709\u679C\u7CD6\uFF0C\u8461\u8404\u7CD6\u3001\u82F9\u679C\u9178\u548C\u6709\u673A\u9178\uFF0C\u5E76\u542B\u8102\u80AA\u3001\u86CB\u767D\u8D28\u3001\u9499\u3001\u78F7\u3001\u94C1\u3001\u7EF4\u751F\u7D20\u3001\u80E1\u841D\u535C\u7D20\u3001\u70DF\u9178\u7B49\u8425\u517B\u7269\u8D28\u3002\u5176\u679C\u5B9E\u4EE5\u4E2A\u5927\u3001\u8089\u8106\u3001\u6C41\u591A\u3001\u5473\u751C\u88AB\u6E56\u5317\u7701\u519C\u4E1A\u5385\u547D\u4E3A\u201C\u6E56\u5317\u5341\u5927\u540D\u679C\u201D\u3002</p><p>2014\u5E7410\u670811\u65E5\uFF0C\u539F\u56FD\u5BB6\u8D28\u68C0\u603B\u5C40\u6279\u51C6\u5BF9\u201C\u767E\u91CC\u6D32\u7802\u68A8\u201D\u5B9E\u65BD\u5730\u7406\u6807\u5FD7\u4EA7\u54C1\u4FDD\u62A4\u3002\u680F\u76EE\u7EC4\u53EF\u4EE5\u8054\u7CFB\u767E\u91CC\u6D32\u9547\u65B9\u9762\u7684\u8054\u7CFB\u4EBA\uFF0C\u6D3D\u8C08\u5E26\u8D27\u4E8B\u5B9C\uFF0C\u5982\u80FD\u91C7\u7EB3\u4E0D\u80DC\u611F\u6FC0\u3002</p><div class="danger custom-block"><p class="custom-block-title">\u9A6C\u7763\u516C\u70B9\u8BC4</p><p>\u611F\u8C22\u63A8\u8350\u5E26\u8D27\u65B9\u5411\uFF0C\u6211\u4EEC\u4F1A\u5B58\u6863\u7684\u3002\u672C\u671F\u6700\u6709\u8DA3\u7684\u5185\u5BB9\u662F\u8FD9\u4E00\u6BB5\uFF1A</p><blockquote><p>\u6700\u8FD1\u56FD\u6709\u94F6\u884C\u5B58\u6B3E\u6BD4\u4F8B\u98D9\u5347\uFF0C\u662F\u56E0\u4E3A\u6295\u8D44\u65E0\u671B\u52A0\u4E0A\u5BF9\u4E2D\u5C0F\u94F6\u884C\u7684\u4E0D\u4FE1\u4EFB\u9020\u6210\uFF0C\u5F80\u5E74\u5E74\u4E2D\u5404\u5927\u884C\u4E3A\u4E86\u5B8C\u6210\u4E1A\u7EE9\u6307\u6807\uFF0C\u4F1A\u53D1\u5E03\u63FD\u50A8\u4EFB\u52A1\uFF0C\u6BD4\u59827\u5929\u9AD8\u606F\u7B49\u7B49\uFF0C\u4ECA\u5E74\u5374\u662F\u6BEB\u65E0\u97F3\u8BAF\u3002\u53CD\u800C\u8D37\u6B3E\u4EFB\u52A1\u56F0\u96BE\u91CD\u91CD\uFF0C\u4E0D\u65AD\u4E0B\u8C03\u5229\u7387\uFF08\u623F\u8D37\uFF0C\u6D88\u8D39\u8D37\uFF0C\u4E2A\u4EBA\u8D37\u90FD\u662F\u5386\u53F2\u540C\u671F\u6700\u4F4E\u6C34\u5E73\uFF09\u4E5F\u5F88\u96BE\u5B8C\u6210</p></blockquote><blockquote><p>\u8BA9\u6211\u8305\u585E\u987F\u5F00\u2014\u2014\u524D\u51E0\u5929\u6211\u8003\u8651\u7C7B\u4F3C\u95EE\u9898\uFF0C\u60F3\u7684\u90FD\u662F\u94F6\u884C\u671F\u5F85\u653F\u5E9C\u5927\u653E\u6C34\uFF0C\u8BA4\u4E3A\u672A\u6765\u7684\u201C\u94B1\u201D\u66F4\u591A\u6240\u4EE5\u5927\u94F6\u884C\u4E0D\u63FD\u50A8\u3002\u73B0\u5728\u60A8\u63D0\u4F9B\u4E86\u65B0\u7684\u89D2\u5EA6\uFF0C\u5982\u8499\u540C\u610F\uFF0C\u5E0C\u671B\u80FD\u5728\u8282\u76EE\u4E0A\u5F15\u7528\u7C7B\u4F3C\u89C2\u70B9\u3002</p></blockquote></div>',14),l=[p];function s(i,r,d,n,_,h){return c(),t("div",null,l)}const k=e(o,[["render",s]]);export{u as __pageData,k as default};
